INSERT INTO `t_per_record` VALUES ('ddcc495c-629b-11e2-ac63-5cff350bc903','潘凡','2008-01-01','0810695','1、肛门、生殖器未查；2、出院诊断缺第7诊断；3、9.20患者查房见精神好，语句错误；4、全身多处复合伤及出血有用止血药4天没有查血型，万一出血再查则延误病情。','93分','0','7c7c3c1f-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc4cf3-629b-11e2-ac63-5cff350bc903','林建滨','2008-01-01','0811536','1、湿疹部位不明确；2、首程拷贝；3、大便常规未粘贴，伪造。','93分','0','7c7c3c1f-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc4e6b-629b-11e2-ac63-5cff350bc903','苏砍','2008-01-01','0811265','1、无右上眼睑、腰背部、臀部多处损伤描述；2、无心电图报告记录；3、首程以后的病程记录再无头痛、头晕记录；4、10.2、10.6记录枕部多发裂伤，而病历里只有一条3cm的裂伤记录；5、医患协议书无医师签名；6、告知书患者未选择告知方式；7、院感调查表未写易感因素。','88分','0','7c7c3c1f-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc4ff1-629b-11e2-ac63-5cff350bc903','刘才文','2008-01-01','0811494','1、病程拷贝现象；2、上级医师分析欠详。','96分','0','7c7c2a0f-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc5132-629b-11e2-ac63-5cff350bc903','刘汉桃','2008-01-01','0811085','1、此次入院前原诊治过程记述不清楚；2、专科体检矛盾，“反应迟钝，言语流利”；3、高密度脂蛋白血症未诊断；4、诊断依据查体不完整；5、胸片双肺间质性改变未记录、未分析；6、未复查血常规。','92分','0','7c7c2a0f-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc5294-629b-11e2-ac63-5cff350bc903','赖松银','2008-01-01','0811567','1、首页空缺一项；2、主诉不完整；3、病史与主诉不密切；4、治疗不全面；5、首程病例特点不突出；6、鉴别诊断不完全。','90分','0','7c7c2b12-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc546b-629b-11e2-ac63-5cff350bc903','鲁威','2008-01-01','0810851','慢性支气管炎急性发作，诊断依据不足。','96分','0','7c7c2b12-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc55ac-629b-11e2-ac63-5cff350bc903','蔡河清','2008-01-01','0811037','1、现病史过简；2、病程存在拷贝现象；3、病程记录中缺术前麻醉探视记录。','94分','0','7c7c3d46-61e5-11e2-975d-5cff350bc903','621d9d05-61e5-11e2-975d-5cff350bc903','XMSWSJ'),('ddcc5709-629b-11e2-ac63-5cff350bc903','李建成','2008-01-01','0811864','1、现病史过简；2、破伤风抗毒素写“T.A.T”；3、门诊清创医嘱未注明；4、病程记录缺三级查房（主治医师）。','91分','0','7c7c