INSERT INTO `sheet1` VALUES ('病房管理','','神经外科','','2008.2.20','','1、重病室病人吸氧已停，导管及湿化瓶仍挂着，2、周围静脉置管无日期、签名，3、灭菌注射用水无开启时间，4、336病房阳台门坏，5、病房家属吸烟，6、药柜脏，药品混乱放置，7、18/2医嘱查对无签名。','93分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db5054f-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','外科','','2008.2.20','','1、抢救室地板脏，2、521床空床有杂物，3、528床、530床周围静脉 置管无日期，4、病房阳台物表脏，5、输液架上凉衣服，6、氧气筒无四防标志。','94分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db4ef88-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','骨二病区','','2008.1.25','','1、618床头桌抽屉、橱柜终末处理不到位，无病人，里面有杂物，2、628门锁坏了，开水房灯坏了，3、639阳台上有盐水架，4、治疗室针筒配药完了无放在无菌盘内，放置治疗车上，5、治疗桌上有一生理盐水100ml过期。','95分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db51396-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','外科','','2008.1.25','','1、520、542两床患者1月4日已停止吸氧，鼻导管仍挂着，2、524床病人外出检查，床单散了，未整理，3、542床头卡坏了，4、药柜脏。','96分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db4ef88-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','内一病区','','2008.2.20','','1、冰箱血袋过期，2、403床病人盖自家被，3、405床病房家属吸烟、泡茶，4、治疗室一次性用品摆放乱、地板脏。','96分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db4e521-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','耳鼻咽喉科','','2008.2.20','','1、病房脏乱，2、A436床无巡视卡。','97分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','内一病区','','2008.1.25','','1、409、415两床不在，灯没有关，2、409病人不在，监护仪没有关。','98分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db4e521-1cf8-11e3-bcc9-70f39533446d','MB',''),('病房管理','','骨二病区','','2008.2.20','','1、632床、639床无床头卡，2.636床阳台地板脏。','98分','0def2ae9-1cf9-11e3-bcc9-70f39533446d','8db51396-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.08','86911','1、首页信息填写不全；2、主诉主要症状描述简单；3、出院诊断无上级医师签名；4、Ⅱ/甲切口，预防性使用抗生素时间过长，使用阿奇霉素时间7天，出院带头孢氨苄4天，不合理；5、诊疗计划简单，病程记录写“激素”不规范；6、医嘱多处药物未写剂型，医师签名难辨认。','86.5分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.1','89686','1、首页涂改；2、抗生素使用时间过长，5天；3、首程病例特点不突出，诊疗计划过简；4、上级医师查房分析记录过简；5、医师签名字迹潦草。','89分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.06','84117','1、入院记录中出院诊断无上级医师审签；2、病程记录中修改未用红笔，未签名及日期；3、入院记录中体格检查写“脊柱四肢见入院志”（神经外科苏砍）。','92分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.12','812720','1、疾病发展变化过程描述不清；2、术后前三天患者主诉疼痛程度描述含糊不清；3、术前讨论记录、手术知情同意书中的手术医师为“洪海填”，而手术记录、术前小结中的手术医师为“林晓青”很混乱；4、短期医嘱涂改一处；5、抗菌素使用达6天，超过规定时限，不合理用药。','93.5分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.04','80124','1、现病史过简；2、病程记录过简。','93分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.04','80147','1、现病史过简；2、病程记录过简。','93分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.05','83467','1、诊断不全；2、病程记录中血压过高，心率不齐未分析原因；3、血常规异常未复查。','93分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.09','89297','1、语句简化，写“无扣浊”；2、肛门、外生殖器未见；3、使用头孢西丁钠时间过长（7天），且未复查血常规；4、签名字迹潦草，无法辨认。','94分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','出院病历','耳鼻咽喉科','蔡河清','2008.11','811037','1、现病史过简；2、病程存在拷贝现象；3、病程记录中缺术前麻醉探视记录。','94分','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB',''),('病历书写','运行病历','耳鼻咽喉科','蔡河清','2008.07','87793','1、诊断依据尚充分；2、鉴别诊断欠详。','不合格','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB','0.5'),('病历书写','运行病历','耳鼻咽喉科','蔡河清','2008.05.14','84993','1、体检中缺周围血管征；2、“甲瘤”手术全麻未查肾功；3、Ⅰ类切口，术后使用抗生素3天。','不合格','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB','0.5'),('病历书写','运行病历','耳鼻咽喉科','蔡河清','2008.06.13','86053','1、专科会诊不及时；2、第9页病历错误多，应重写；3、上级医师签名不及时。','不合格','0def29ba-1cf9-11e3-bcc9-70f39533446d','8db506f0-1cf8-11e3-bcc9-70f39533446d','MB','0.5'),('病历书写','运行病历','耳鼻咽喉科','蔡河清