INSERT INTO `input` VALUES (27,'潘凡','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c3c1f-61e5-11e2-975d-5cff350bc903','2008.11','0810695','1、肛门、生殖器未查；2、出院诊断缺第7诊断；3、9.20患者查房见精神好，语句错误；4、全身多处复合伤及出血有用止血药4天没有查血型，万一出血再查则延误病情。',NULL,'93分','0','83d126e5-61e7-11e2-975d-5cff350bc903'),(28,'林建滨','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c3c1f-61e5-11e2-975d-5cff350bc903','2008.11','0811536','1、湿疹部位不明确；2、首程拷贝；3、大便常规未粘贴，伪造。',NULL,'93分','0','83d126e5-61e7-11e2-975d-5cff350bc903'),(29,'苏砍','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c3c1f-61e5-11e2-975d-5cff350bc903','2008.11','0811265','1、无右上眼睑、腰背部、臀部多处损伤描述；2、无心电图报告记录；3、首程以后的病程记录再无头痛、头晕记录；4、10.2、10.6记录枕部多发裂伤，而病历里只有一条3cm的裂伤记录；5、医患协议书无医师签名；6、告知书患者未选择告知方式；7、院感调查表未写易感因素。',NULL,'88分','0','83d126e5-61e7-11e2-975d-5cff350bc903'),(30,'刘才文','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2a0f-61e5-11e2-975d-5cff350bc903','2008.11','0811494','1、病程拷贝现象；2、上级医师分析欠详。',NULL,'96分','0','83cedb94-61e7-11e2-975d-5cff350bc903'),(31,'刘汉桃','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2a0f-61e5-11e2-975d-5cff350bc903','2008.11','0811085','1、此次入院前原诊治过程记述不清楚；2、专科体检矛盾，“反应迟钝，言语流利”；3、高密度脂蛋白血症未诊断；4、诊断依据查体不完整；5、胸片双肺间质性改变未记录、未分析；6、未复查血常规。',NULL,'92分','0','83cedb94-61e7-11e2-975d-5cff350bc903'),(32,'赖松银','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.11','0811567','1、首页空缺一项；2、主诉不完整；3、病史与主诉不密切；4、治疗不全面；5、首程病例特点不突出；6、鉴别诊断不完全。',NULL,'90分','0','83cee2e7-61e7-11e2-975d-5cff350bc903'),(33,'鲁威','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.11','0810851','慢性支气管炎急性发作，诊断依据不足。',NULL,'96分','0','83cee2e7-61e7-11e2-975d-5cff350bc903'),(34,'蔡河清','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c3d46-61e5-11e2-975d-5cff350bc903','2008.11','0811037','1、现病史过简；2、病程存在拷贝现象；3、病程记录中缺术前麻醉探视记录。',NULL,'94分','0','83d12eff-61e7-11e2-975d-5cff350bc903'),(35,'李建成','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2d1f-61e5-11e2-975d-5cff350bc903','2008.11','0811864','1、现病史过简；2、破伤风抗毒素写“T.A.T”；3、门诊清创医嘱未注明；4、病程记录缺三级查房（主治医师）。',NULL,'91分','0','83ceea8c-61e7-11e2-975d-5cff350bc903'),(36,'朱冰封','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.11','0810856','1、病史中对痰的颜色不详，气促是活动后气促还是休息时也气促描述不详；2、“喘息性支气管炎”诊断名称不准确；3、抗菌药物使用依据不足，血象不高，无黄痰，细菌感染依据不足，未作痰培养、咽拭子培养；4、上级医师查房诊断依据与鉴别诊断分析欠详；5、血象异常未复查；6、标点符号错误。',NULL,'85分','0','83ced4fb-61e7-11e2-975d-5cff350bc903'),(37,'邓玉林','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.11','0811003','1、原诊治过程记述不清楚，症状特点描述不全面；2、更换抗生素依据不足，未作血培养、咽拭子培养等；3、缺出院前一天记录，病历拷贝2处；4、上级查房分析过简；5、9.25临时医嘱无医师签名。',NULL,'89.5分','0','83ced4fb-61e7-11e2-975d-5cff350bc903'),(38,'胡睿','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2fb0-61e5-11e2-975d-5cff350bc903','2008.11','0810897','1、主诉“左下腹疼痛一天”应写为“左下腹疼痛1天”；2、腹痛性质未描述；3、缺外伤、手术史；4、缺表情描述；5、复查血常规WBC 2.80×109/L，未分析原因；6、9.24停用抗生素病程写继续抗感染；7、患者9.29出院，病程写9.27出院；8、地址只写“翔安区新店镇”，不够详细；9、住院病案质量评定表填写不全；10、多处药物剂型未写。',NULL,'91分','0','83ceee4c-61e7-11e2-975d-5cff350bc903'),(39,'陈魁夫','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2fb0-61e5-11e2-975d-5cff350bc903','2008.11','0810662','1、诊疗计划完善检查未写具体检查项目；2、上级医师查房记录过简；3、最后一次病程记录上级医师签字不及时（日期不符合）；4、心电图单缺填门诊号；5、手术记录出血量写成“50cm”，记录者未写记录日期；6、9.15、9.16医嘱无医师签名。',NULL,'92分','0','83ceee4c-61e7-11e2-975d-5cff350bc903'),(40,'俞德良','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c2fb0-61e5-11e2-975d-5cff350bc903','2008.11','0811830','1、上级医师查房分析欠详；2、术前小结意外情况处理措施未写，拟行手术日期、时间未写。',NULL,'93分','0','83ceee4c-61e7-11e2-975d-5cff350bc903'),(41,'王贤生','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c4160-61e5-11e2-975d-5cff350bc903','2008.11','0810784','1、体检中“巩膜”写为“巩无膜”；2、病程中“病史记载”写为“病史可载”；3、上级医师查房分析欠详细；4、抗生素使用不合理；5、更改医嘱病程记录不详。',NULL,'90分','0','83d1389f-61e7-11e2-975d-5cff350bc903'),(42,'陈仲育','621d9d05-61e5-11e2-975d-5cff350bc903','7c7c4160-61e5-11e2-975d-5cff350bc903','2008.11','0810673','1、受伤2天“大小便未解”？；2、心脏体检不正确，患者心电图及胸片提示有“高心病”，但体检均正常。3、Ⅰ类手术使用抗生素时间过长，超过72小时。4、高血压患者未请相关科室协诊。5、对术后恢复情况及资料分析过简；6、9.17血压153/105mmHg未做分析与处理；7、字迹潦草。',NULL,'92分','0 ','83d1389f-61e7-11e2-975d-5cff350bc903'),(43,'曾华东','621d9d05-6