3d145bf-61e7-11e2-975d-5cff350bc903'),(3865,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c34fe-61e5-11e2-975d-5cff350bc903','2008.10.06',NULL,'1、值班医师呼吸机使用欠熟练；\r\n2、输液登记本不规范。\r\n',NULL,'不合格',NULL,'83d112be-61e7-11e2-975d-5cff350bc903'),(3866,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c3c1f-61e5-11e2-975d-5cff350bc903','2008.10.06',NULL,'1、科周会补至2008年7月19日；\r\n2、2008年医疗纠纷登记本写在两本上（应为一本）；\r\n3、医生交接班本书写过简，新入病人未按规定书写；\r\n4、科室三基考试9月份不全，缺个别医师。\r\n',NULL,'不合格',NULL,'83d12bd0-61e7-11e2-975d-5cff350bc903'),(3867,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c2a0f-61e5-11e2-975d-5cff350bc903','2008.10.06',NULL,'1、死亡病例交接班本写自动出院；\r\n2、病危、血压下降患者无抢救记录。\r\n',NULL,'不合格',NULL,'83ceddfc-61e7-11e2-975d-5cff350bc903'),(3868,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c2b12-61e5-11e2-975d-5cff350bc903','2008.10.06',NULL,'有抢救记录，交接班本未体现。',NULL,'不合格',NULL,'83cee5db-61e7-11e2-975d-5cff350bc903'),(3869,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c2fb0-61e5-11e2-975d-5cff350bc903','2008.08.31',NULL,'1、科室人员资料：缺林川；\r\n2、6月5日有死亡患者，交接班本未写；\r\n3、交接班本书写过简，术后情况书写过简，10月2日交接班本眉栏空缺；\r\n4、三基考试缺8、9月份。\r\n',NULL,'不合格',NULL,'83cef19f-61e7-11e2-975d-5cff350bc903'),(3870,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c2900-61e5-11e2-975d-5cff350bc903','2008.08.31',NULL,'1、抢救患者无病重、病危通知；\r\n2、医生办公室有黄色塑料垃圾桶。\r\n',NULL,'不合格',NULL,'83ced813-61e7-11e2-975d-5cff350bc903'),(3871,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c4160-61e5-11e2-975d-5cff350bc903','2008.08.31',NULL,'1、科室人员资料：缺部分职称证书、毕业证书、资格证书、执业证书；\r\n2、质控资料：自查部分及整改措施拷贝，不能体现整改效果；\r\n3、抢救记录本：缺；\r\n4、业务学习本：每月缺一次（要求大于5人的科室每月至少两次）。\r\n',NULL,'不合格',NULL,'83d13a3b-61e7-11e2-975d-5cff350bc903'),(3872,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c4290-61e5-11e2-975d-5cff350bc903','2008.10.06',NULL,'1、术前讨论：无证医师应写为“试用医师”，无下级医师签字的上级医师不能用红笔签字；\r\n2、质控本参加人员栏无医师手签。\r\n',NULL,'不合格',NULL,'83d13f65-61e7-11e2-975d-5cff350bc903'),(3874,NULL,'621da5b4-61e5-11e2-975d-5cff350bc903','7c7c340a-61e5-11e2-975d-5cff350bc903','2008.11.22',NULL,'1、心电图图像报告单无患者姓名等一